import React from 'react';

function Footer() {
  return (
    <footer className="footer">
      <p>Folonite.js was made and is handled by <strong>Folonite</strong>.</p>
      <p>Your contributions are what will make this framework alive and grow.</p>
      <p>
        <a href="https://github.com/folonite" target="_blank" rel="noopener noreferrer">Contribute on GitHub</a> | &copy; 2024 Folonite. All Rights Reserved.
      </p>
    </footer>
  );
}

export default Footer;
